 Typist
 ===============================================*/
@-webkit-keyframes blink {
    0% {
        opacity: 1.0;
    }
    50% {
        opacity: .0;
    }
    100% {
        opacity: 1.0;
    }
}
@keyframes blink {
    0% {
        opacity: 1.0;
    }
    50% {
        opacity: .0;
    }
    100% {
        opacity: 1.0;
    }
}

.typist-blink:after {
    position: relative;
    top: 10px;
    display: inline-block;
    height: 47px;
    margin-right: 7px;
    margin-left: 3px;
    content: " ";
    -webkit-animation: blink 1s step-start 0s infinite;
            animation: blink 1s step-start 0s infinite;
    border-right: 2px solid;
}

.typist-blink > .selectedText {
