.accordion > dt {
    margin-bottom: 10px;
    letter-spacing: .2em;
    text-transform: uppercase;
    font-size: 14px;
    font-weight: 400;
}

.accordion.time-line > dt > a {
    background: none;
}

.accordion > dt > a {
    position: relative;
    display: block;
    padding: 14px 20px;
    text-decoration: none;
    /*font-family: 'Abel', sans-serif;*/
    letter-spacing: 2px;
    color: #222;
    border: 1px solid #e8e8e8;
    background: #e8e8e8;
}

.accordion > dt > a:hover {
    text-decoration: none;
}

.accordion > dt > a:hover,
.accordion > dt > a.active {
    cursor: pointer;
    color: #fff;
    border-color: #222;
    background: #222;
}

.accordion > dt > a:after {
    position: absolute;
    top: 50%;
    right: 10px;
    width: 15px;
    height: 15px;
    margin-top: -8px;
    content: "\E648";
    text-align: center;
    text-transform: none;
    color: #696969;
    font-family: "icomoon";
    font-size: 16px;
    font-weight: normal;
    font-style: normal;
    font-variant: normal;
    line-height: 15px;

    -webkit-font-smoothing: antialiased;
    speak: none;
}

.accordion > dt > a.active:after,
.accordion > dt > a.active:hover:after {
    content: "\E641";
    color: #fff;
}

.accordion > dt > a:hover:after {
    color: #fff;
}

