/*------------------------------------------------------------------
    timeline
-------------------------------------------------------------------*/
.timeline {
    position: relative;
    display: table;
    width: 100%;
    table-layout: fixed;
    border-spacing: 0;
    border-collapse: collapse;
}

.timeline .time-show {
    position: relative;
    margin-top: 30px;
    margin-right: -75px;
    margin-bottom: 30px;
}

.timeline .time-show a {
    color: #fff;
}

.timeline:before {
    position: absolute;
    z-index: 0;
    top: 30px;
    bottom: 0;
    left: 50%;
    width: 1px;
    content: "";
    background-color: #d8d9df;
}

h3.timeline-title {
    margin: 0;
    margin: 0 0 5px;
    text-transform: uppercase;
