.timeline-item.alt:after {
    display: block;
    width: 50%;
    content: "";
}

.timeline-item {
    display: table-row;
    display: inline-table;
    width: 100%;
    margin-bottom: 50px;
}

.timeline-desk {
    position: relative;
    display: table-cell;
    width: 50%;
    vertical-align: top;
}

.timeline-desk h1 {
    margin: 0 0 5px;
    font-size: 16px;
    font-weight: 400;
}

