    display: none;
}

.flexslider {
    position: relative;
    margin: 0;
    padding: 0;
}

.flex-viewport {
    max-height: 2000px;
    -webkit-transition: all 1s ease;
            transition: all 1s ease;
}

.flex-control-nav {
    position: absolute;
    z-index: 10;
    right: 15px;
    bottom: 15px;
    margin: 0;
    text-align: center;
}

.flex-control-nav li {
    display: block;
    float: left;
    width: 10px;
    height: 10px;
    margin: 0 3px;
}

.flex-control-nav li a {
    display: block;
    width: 10px;
    height: 10px;
    cursor: pointer;
    -webkit-transition: all .3s ease-in-out;
         -o-transition: all .3s ease-in-out;
            transition: all .3s ease-in-out;
    text-indent: -9999px;
    border: 1px solid #fff;
    border-radius: 50%;
}

.flex-control-nav li:hover a,
.flex-control-nav li a.flex-active {
    background-color: #fff;
}

.flex-direction-nav {
    margin: 0;
    padding: 0;
    list-style: none;
}

.flex-direction-nav {
    *height: 0;
}

.flex-direction-nav a {
    position: absolute;
    z-index: 200;
    top: 50%;
    display: block;
    overflow: hidden;
    width: 40px;
    height: 40px;
    margin: -40px 0 0;
    cursor: pointer;
    -webkit-transition: all .3s ease-in-out;
            transition: all .3s ease-in-out;
    text-decoration: none;
    color: rgba(0, 0, 0, .8);
    background-color: rgba(0, 0, 0, .5);
    line-height: 40px;
}

.flex-direction-nav a:hover {
    background-color: rgba(0, 0, 0, .7);
}

.flex-direction-nav a:before {
    display: block;
    width: 40px;
    content: "\F104";
    text-align: center;
    color: #fff;
    font-family: "fontawesome";
    font-size: 16px;
}

.flex-direction-nav a.flex-next:before {
    content: "\F105";
}

.flex-direction-nav .flex-prev {
    left: 0;
}

.flex-direction-nav .flex-next {
    right: 0;
    text-align: right;
}

.post-slider-thumb .flex-control-thumbs {
    position: relative;
    z-index: 10;
    top: 10px;
    right: auto;
    left: auto;
    margin: 0 auto;
    text-align: left;
}

